import React from 'react';

import CharacterEditor from './components/CharacterEditor';
import Footer from './components/Footer';

function App() {
  return (
    <>
    <div className='decorative-line'>
      <CharacterEditor />
      <Footer />
      </div>
    </>
  );
}

export default App;
